import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import React from "react";
import './styles.css';
import { Link } from 'react-router-dom';


function NavbarBS() {
    return (
        <Navbar collapseOnSelect expand="lg" bg="light" variant="light" className='navbarBS'>
            <Container>
                <Navbar.Brand className='logoContainer'>
                    <img src="images/logo-blue.png" alt="logo" />
                </Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                    <Nav className="me-auto">
                        <Nav.Link>
                            <Link to="/" className="nav-element">Home</Link>
                        </Nav.Link>
                        <Nav.Link>
                            <Link to="/construccion" className="nav-element">Construcción</Link>
                        </Nav.Link>
                        <Nav.Link>
                            <Link to="/luces" className="nav-element">Luces</Link>
                        </Nav.Link>
                        <Nav.Link>
                            <Link to="/solar" className="nav-element">Calefacción Solar</Link>
                        </Nav.Link>
                        <Nav.Link>
                            <Link to="/baby-safe" className="nav-element">Baby Safe</Link>
                        </Nav.Link>
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
}

export default NavbarBS;
